import logo from "./logo.svg";
import { YoutubeData } from "./YoutubeData";
import "./App.css";

/**
 * element = <div id = "root"> hello world</div>
 * element = React.createElement("div", {id: 'root'}, 'Hello world');
 *
 */

function App() {
  return (
    // children component
    <div className="youtube-list">
      {YoutubeData.map((item, index) => {
        let newClass = " ";
        if (index === 1) {
          newClass = "abc";
        }

        return (
          <Youtube
            key={item.id}
            header={item.header}
            image={item.image}
            avatar={item.avatar || item.image}
            title={item.title}
            author={item.author}
            className={newClass}
          ></Youtube>
        );
      })}
    </div>
  );
}

function Youtube(props) {
  return (
    <div className={`youtube-item ${props.className}`}>
      {/* <div className="youtube-img">
        <img src={props.image} alt="youtube" />
      </div>
      <div className="youtube-title">
        <h2>{props.title || "This is example of title"}</h2>
      </div>
      <div className="youtube-footer">
        <div className="youtube-avata">
          <img src={props.avata} alt="" />
        </div>
        <div className="youtube-author">
          <h3>{props.author || "This is example of author"}</h3>
        </div>
      </div> */}
      <div className="main">
        <header className="youtube-header">
          <img src={props.header} alt="" />
        </header>
        <div className="youtube-body">
          <div className="y-content-img">
            <img
              className="youtube-img"
              src={props.image || "no-image"}
              alt=""
            />
          </div>

          <div className="youtube-title">
            <h2 className="title">{props.title}</h2>
            <h3 className="youtube-des">{props.des}</h3>
          </div>
        </div>

        <div className="footer">
          <img className="avatar" src={props.avatar} alt="" />
          <p className="youtube-author">{props.author}</p>
        </div>
      </div>
    </div>
  );
}

export default App;
